import React from 'react';
import {Button, Form, Input, InputNumber, Row, Select, SelectProps, Statistic} from "antd";
import {Instrument} from "../../../shared/enumes";

export const Ticker: React.FC = () => {
    return (
        <Form>
            <Form.Item>
                <h1>Ticker</h1>
            </Form.Item>
            <Form.Item>
                <Select
                    placeholder="Choose instrument"
                    options={(Object.keys(Instrument) as Array<keyof typeof Instrument>).map((key) => {
                        return {
                            value: key.toString(),
                            label: key.toString()
                        }
                    })}
                    onChange={() => {}}
                />
            </Form.Item>
            <Form.Item>
                <InputNumber
                    placeholder="Set amount"
                    onChange={() => {}}
                />
            </Form.Item>
            <Form.Item>
                <Row>
                    <Form
                        style={{width: "50%"}}
                    >
                        <Form.Item>
                            <Statistic
                                title="Buy"
                                value={123}
                            />
                            <Button title="Buy"></Button>
                        </Form.Item>
                    </Form>
                    <Form
                        style={{width: "50%"}}
                    >
                        <Form.Item>
                            dsa
                        </Form.Item>
                    </Form>
                </Row>
            </Form.Item>
        </Form>
    );
};
